package fixtures

import didkey "github.com/KenCloud-Tech/go-ucan-kc/key"

type Identities struct {
	AliceKey   didkey.KeyMaterial
	BobKey     didkey.KeyMaterial
	MalloryKey didkey.KeyMaterial

	AliceDidString   string
	BobDidString     string
	MalloryDidString string
}

var TestIdentities Identities

func init() {
	var err error
	TestIdentities.AliceKey, err = didkey.NewDidKeyPairFromPrivateKeyString("")
	if err != nil {
		panic(err.Error())
	}
	TestIdentities.AliceDidString, err = TestIdentities.AliceKey.DidString()
	if err != nil {
		panic(err.Error())
	}

	TestIdentities.BobKey, err = didkey.NewDidKeyPairFromPrivateKeyString("")
	if err != nil {
		panic(err.Error())
	}
	TestIdentities.BobDidString, err = TestIdentities.BobKey.DidString()
	if err != nil {
		panic(err.Error())
	}

	TestIdentities.MalloryKey, err = didkey.NewDidKeyPairFromPrivateKeyString("")
	if err != nil {
		panic(err.Error())
	}
	TestIdentities.MalloryDidString, err = TestIdentities.MalloryKey.DidString()
	if err != nil {
		panic(err.Error())
	}
}
